window.bookSummaryJSON = "<p>War is coming... and Micheal must be ready. Meanwhile, Constantine Lancaster is impressed, and makes an unexpected decision that alters the course of human history. </p> <p>As Micheal races to meet up with Sophia and Shin at the the Soul King's Inheritance, tensions begin to rise across the Second Layer. Old enemies and friends alike must work together as they face off against the World's Strongest in a catastrophic battle that will decide the fate of the Second Layer. And then... it happened. The unthinkable. Micheal finds himself face to face with the worst case scenario....</p> <p>\"When fighting against Gods, there's really only one piece of advice I can offer.\" \"Never, under any circumstances, fight fair.\"</p>"; 
